import './App.css';
import Header from './components/header.jsx';
import Nav from './components/nav.jsx';
import Foto from './img/fotofer.png'

function App() {
  return (
    <div className='bg-principal'>
      <Header/>
      <Nav/>
      <div className='bg-gold flex '>
        <img src={Foto} alt="Foto de Fernanda" />
      </div>
    </div>
  );
}

export default App;
